import React from 'react';
import './formulario.css'; // Importa el archivo de estilos si es necesario

const Header = () => {
  return (
    <header>
      <nav className="navbar">
      <div class="hamburger-menu">
        <div class="line"></div>
        <div class="line"></div>
        <div class="line"></div>
      </div>
        <div className="logo">ICPC-UMSS</div>
        <div className="search">
        <input type="text" placeholder="Buscar..." />
      </div>
        <div className="user">
          <img src="user-avatar.jpg" alt="Avatar" />
          <a href="#">Nombre de Usuario</a>
        </div>
      </nav>
    </header>
  );
};

export default Header;
